 I'm trying to find a way to close the previously opened Tooltip when a new one is opened.

Here is the code:

\begin{code}
import React, from 'react';
import ReactDOM from 'react-dom';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = () => {
  const { tooltip, openTooltip, closeTooltip } = React.useContext(TooltipContext);

  if (!tooltip) return null;

  return ReactDOM.createPortal(
    <div className="tooltip">
      {tooltip}
      <button onClick={closeTooltip}>Close</button>
    </div>,
    document.body
  );
};

const App = () => {
  const { openTooltip } = React.useContext(TooltipContext);

  return (
    <TooltipProvider>
      <button onClick={() => openTooltip('Tooltip 1')}>Open Tooltip 1</button>
      <button onClick={() => openTooltip('Tooltip 2')}>Open Tooltip 2</button>
      <Tooltip />
    </TooltipProvider>
  );
};
\end{code}

The problem is that the `Tooltip` component is not being re-rendered when the `tooltip` state changes. This is because the `Tooltip` component is not a direct child of the `TooltipProvider` component.

How can I make the `Tooltip` component re-render when the `tooltip` state changes?

Answer: You can use the `useEffect` hook to re-render the `Tooltip` component when the `tooltip` state changes.

Here is the updated code:

\begin{code}
import React, { useEffect } from 'react';
import ReactDOM from 'react-dom';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = () => {
  const { tooltip, openTooltip, closeTooltip } = React.useContext(TooltipContext);

  useEffect(() => {
    if (tooltip) {
      // Re-render the tooltip when the tooltip state changes
      ReactDOM.render(
        <div className="tooltip">
          {tooltip}
          <button onClick={closeTooltip}>Close</button>
        </div>,
        document.body
      );
    } else {
      // Remove the tooltip when the tooltip state is null
      ReactDOM.unmountComponentAtNode(document.body);
    }
  }, [tooltip]);

  return null;
};

const App = () => {
  const { openTooltip } = React.useContext(TooltipContext);

  return (
    <TooltipProvider>
      <button onClick={() => openTooltip('Tooltip 1')}>Open Tooltip 1</button>
      <button onClick={() => openTooltip('Tooltip 2')}>Open Tooltip 2</button>
      <Tooltip />
    </TooltipProvider>
  );
};
\`

